//函数内部获取本函数名称 getfunname(arguments.callee.toString())
function getfunname(funs) {
    var rval="";
    funs=funs.replace("{","\r\n{");
    var i,firstline;
    i=funs.indexOf("\r\n");
    if(i>-1)
        firstline=funs.substring(0,i);
    else
        firstline=funs;
    rval=firstline.replace("function","");
    i=rval.indexOf("(");
    if(i>-1)
        rval=rval.substring(0,i);
    rval=rval.replace(new RegExp(" ","g"),"");
    if(rval=="")rval=firstline;

    return rval;
}
//获取浏览器宽高
function getViewportSize(w){
    w= w || window;
    //除了IE8以及更早版本外，其它浏览器都能用
    if(w.innerWidth != null){ return { w:w.innerWidth, h:w.innerHeight } };
    //对标准模式下的IE或任何浏览器
    var d=w.document;
    if(document.compatMode == "CSS1Compat"){
        return { w:d.documentElement.clientWidth,
            h:d.documentElement.clientHeight }
    }
    //对怪异模式下的浏览器
    return { w:d.body.clientWidth , h:d.body.clientHeight }
}
/*
* cookie相关操作方法
*/
/*设置cookie*/
function setCookie(name, value, iDay) {
    var oDate=new Date();
    oDate.setDate(oDate.getDate()+iDay);
    document.cookie=name+'='+value+';expires='+oDate;
}
/*使用方法：setCookie('user', 'simon', 11);*/
/*获取cookie*/
function getCookie(name) {
    var arr=document.cookie.split('; '); //多个cookie值是以; 分隔的，用split把cookie分割开并赋值给数组
    for(var i=0;i<arr[i].length;i++) //历遍数组
    {
        var arr2=arr[i].split('='); //原来割好的数组是：user=simon，再用split('=')分割成：user simon 这样可以通过arr2[0] arr2[1]来分别获取user和simon
        if(arr2[0]==name) //如果数组的属性名等于传进来的name
        {
            return arr2[1]; //就返回属性名对应的值
        }
        return ''; //没找到就返回空
    }
}
/*使用方法：getCookie('user')*/
/*删除cookie*/
function removeCookie(name)
{
    setCookie(name, 1, -1); //-1就是告诉系统已经过期，系统就会立刻去删除cookie
};
/*使用方法：removeCookie('user')*/

/*
* js加密解密
*/
function encryption(code){ //对字符串进行加密
    var c=String.fromCharCode(code.charCodeAt(0)+code.length);
    for(var i=1;i<code.length;i++){
        c+=String.fromCharCode(code.charCodeAt(i)+code.charCodeAt(i-1));
    }
    return escape(c);
}
function decrypt(code){   //字符串进行解密
    code=unescape(code);
    var c=String.fromCharCode(code.charCodeAt(0)-code.length);
    for(var i=1;i<code.length;i++){
        c+=String.fromCharCode(code.charCodeAt(i)-c.charCodeAt(i-1));
    }
    return c;
}
