//确认提交数据并提交
$(document).on("click",".sure_commit",function(){
    var url=$(this).attr("href")?$(this).attr("href"):$(this).attr("url");
    var option=$(this).attr("data");
    var buffer=option.split("&");
    var obj={};
    $.each(buffer,function(item,temp){
        var buf=temp.split("=");
        obj[buf[0]]=buf[1];
    });
    var title=$(this).attr("title")?$(this).attr("title"):"确认删除";
    $confirm(title,function(){
        $post(url,obj);
    });
    return false;
});
