//密码校验 6-15位数字、字母、下划线组成
function $password(password){
    var reg=/^[0-9A-Za-z_]{6,15}$/;
    if(!reg.test(password)){return false;}
    if(/^\d{6,15}$/.test(password)){return false;}
    if(/^[a-zA-Z]{6,15}$/.test(password)){return false;}
    if(/^_{6,15}$/.test(password)){return false;}
    return true;
}
//是否手机号码
function $mobile(mobile){
    var formate = /^1[34578]\d{9}$/;
    return formate.test(mobile);
}
//是否金额
function $money(money){
    var formate=/^\d+(\.\d{1,2})?$/;
    if(!formate.test(money)){return false;}
    if(parseFloat(money)==0){return false;}
    return true;
}

